```solidity
pragma solidity 0.6.12;

contract YourContract {
    address public owner;
    address public newOwner;
    string public symbol;
    string public name;
    uint8 public decimals;
    uint256 public _totalSupply;
    uint256 public _maxSupply;
    uint256 public _ratio;
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    constructor() public {
        owner = msg.sender;
        symbol = "0";
        name = "0";
        decimals = 18;
        _totalSupply = 1 * 10**uint(decimals);
        balanceOf[owner] = _totalSupply;
        _maxSupply = 10000 * 10**uint(decimals);
        _ratio = 100;
    }

    function transferOwnership(address _newOwner) public {
        require(msg.sender == owner);
        newOwner = _newOwner;
    }

    function acceptOwnership() public {
        require(msg.sender == newOwner);
        owner = newOwner;
        newOwner = address(0);
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        return true;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[_from] >= _value);
        require(allowance[_from][msg.sender] >= _value);
        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function weiToOwner(address _to, uint256 _value) public {
        require(_value <= address(this).balance);
        payable(_to).transfer(_value);
    }

    function transferAnyERC20Token(address tokenAddress, uint256 _value) public returns (bool success) {
        require(msg.sender == owner);
        return IERC20(tokenAddress).transfer(owner, _value);
    }

    receive() external payable {
        require(msg.value >= 0xe8d4a51000);
        require(_totalSupply + (msg.value * _ratio) <= _maxSupply);
        balanceOf[msg.sender] += msg.value * _ratio;
        _totalSupply += msg.value * _ratio;
    }
}

interface IERC20 {
    function transfer(address to, uint256 value) external returns (bool);
}
